import { useNavigate } from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    navigate('/forex-pair');  // Przenosi na stronę ForexPair
  };

  return (
    <main className="flex flex-col items-center justify-center container mx-auto p-4 mt-20">
      {/* Akapit z tekstem powitalnym */}
      <p className="text-lg text-gray-300 text-center max-w-2xl mb-8">
        Welcome to the Forex Pairs page. Here, you can explore different currency pairs and analyze their trends using advanced AI-powered tools.
      </p>

      {/* Przycisk "Zacznij już teraz" */}
      <button
        onClick={handleButtonClick}
        className="bg-sky-500 hover:bg-sky-700 text-white font-bold py-4 px-8 rounded-full text-xl shadow-lg transform hover:scale-105 transition-transform duration-300"
      >
        Zacznij już teraz
      </button>
    </main>
  );
}
